To solve this problem, we can use the extended Euclidean algorithm. The extended Euclidean algorithm is an extension of the Euclidean algorithm that also computes the coefficients x and y of Bézout's identity, which states that for any two integers a and b, there exist integers x and y such that ax + by = gcd(a, b).

In our case, we want to find the modular multiplicative inverse of a modulo m, which means we want to find an integer x such that ax ≡ 1 (mod m).

